import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import Hero from './components/hero/Hero';
import Navbar from './components/navbar/Navbar.jsx';


function App() {
  return (
    <Router>
      <div className='app__container'>
        <div className='app__box'>
          <Navbar/>
          <Hero />
          <Routes>
            <Route path="/" />
            <Route path="/purpose" />
            <Route path="/ourstory" />
            <Route path="/ourteam" />
            <Route path="/roadmap" />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
